import styled from "styled-components";

export const Head = styled.header`
  display:flex;
  justify-content:space-between;
  align-items:center;
  padding:20px;
`;
export const Logo = styled.a`
  height:50px;
  width:280px;
  & img{
      height:100%;
    width:100%;
    object-fit:contain
  }
`;
export const List = styled.ul`
  display:flex;
  padding:0;
  margin:0;
  list-style:none;

`;
export const Item = styled.li`
  & a {
    color: white;
    text-decoration: none;
    margin-right: 30px;
    transition: all 0.6s ease;
    position:relative;
    &:after {
      content: "";
      border-bottom: 1px solid white;
      width:0;
      transition:linear .5s ease-out;
      border-bottom: 1px solid white;
      position:absolute;
      bottom: 0;
      left:0;
    }
    &:hover {
      transition: all 0.6s ease;
      &:after {
        content: "";
        transition:linear .5s ease-in;
        width:100%
      }
    }
  }
`;
